import React from 'react';

function TrainingInformation() {
  const subjects = [
    {
      name: 'Back',
      imageSrc: 'back-image.jpg',
      info: [
        ['Lorem ipsum, dolor sit amet consectetur adipisicing elit. Consectetur ex provident vitae. Excepturi tempora nulla sapiente veritatis quasi, quaerat quis officiis ab illum commodi nesciunt exercitationem fugit sit quam reprehenderit?', 'Information 2 for Back', 'Information 3 for Back'],
        ['Information 4 for Back', 'Information 5 for Back', 'Information 6 for Back'],
      ],
    },
    {
      name: 'Chest',
      imageSrc: 'chest-image.jpg',
      info: [
        ['Information 1 for Chest', 'Information 2 for Chest', 'Information 3 for Chest'],
        ['Information 4 for Chest', 'Information 5 for Chest', 'Information 6 for Chest'],
      ],
    },
    {
      name: 'Legs',
      imageSrc: 'legs-image.jpg',
      info: [
        ['Information 1 for Legs', 'Information 2 for Legs', 'Information 3 for Legs'],
        ['Information 4 for Legs', 'Information 5 for Legs', 'Information 6 for Legs'],
      ],
    },
    {
      name: 'Hands',
      imageSrc: 'hands-image.jpg',
      info: [
        ['Information 1 for Hands', 'Information 2 for Hands', 'Information 3 for Hands'],
        ['Information 4 for Hands', 'Information 5 for Hands', 'Information 6 for Hands'],
      ],
    },
    {
      name: 'Shoulders',
      imageSrc: 'shoulders-image.jpg',
      info: [
        ['Information 1 for Shoulders', 'Information 2 for Shoulders', 'Information 3 for Shoulders'],
        ['Information 4 for Shoulders', 'Information 5 for Shoulders', 'Information 6 for Shoulders'],
      ],
    },
  ];


  return (
    <div>
    <h1>Subjects</h1>
    {subjects.map((subject, index) => (
      <div key={index}>
        <h2>{subject.name}</h2>
        <img src={subject.imageSrc} alt={subject.name} width="300" height="400" />

        <div>
          <table style={{ width: '300px' }}>
            <tbody>
              {subject.info.map((info, infoIndex) => (
                <tr key={infoIndex}>
                  <td>{info}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    ))}
  </div>
  );
}

export default TrainingInformation;
